$(document).ready(function(){$(".delete").click(function(a){a.preventDefault();swal({title:"Are you sure?",text:"You will not be able to recover it if you do!",type:"warning",showCancelButton:true,confirmButtonColor:"#DD6B55",confirmButtonText:"Yes, delete it!",cancelButtonText:"No, cancel!",closeOnConfirm:false,closeOnCancel:false},function(c){if(c){var b=$(a.target).parent("a");$.get(b.attr("href"),function(d){b.parentsUntil("tr").parent().remove();swal("Deleted!","Your item has been deleted.","success")})}else{swal("Cancelled","Your item is safe :)","error")}})});$(".logout-button").click(function(a){a.preventDefault();swal({title:"Logout",text:"Are you sure you want to log out?",type:"warning",showCancelButton:true,confirmButtonColor:"#5dc2f1",confirmButtonText:"Yes!",cancelButtonText:"No!",closeOnConfirm:false,closeOnCancel:true},function(c){if(c){var b=$(a.target);window.location.href=b.closest("a").attr("href")}})});$("a.confirmed-add").each(function(a,b){b=$(b);b.remove();swal({title:"Good job!",text:b.html(),type:"success",confirmButtonText:"Ok!"},function(){window.location.href=b.attr("href")})});$(".checkbox-submit").on("change",function(c){var b=$(c.target);var a=b.siblings("input");if(!b.prop("checked")&&a.val()!="uninstalled"){swal({title:"Do you also want to delete all data?",text:"You will not be able to recover it if you do!",type:"warning",showCancelButton:true,confirmButtonColor:"#5dc2f1",confirmButtonText:"Yes, delete it!",cancelButtonText:"No, keep it please!",closeOnConfirm:true,closeOnCancel:true},function(d){if(d){a.val("delete-data")}else{a.val("keep-data")}})}})});